import React from 'react';


class SizeList extends React.Component {
    render() {
        return (
            this.props.sizes.map(size => {
                <label class="size_label">
                    <input type="radio" name="size" value={size} key={size}/>
                    <span>{size}</span>
                </label>
            })
        )
    }
}

export default SizeList;
